import { Count } from "@mui/material";

interface TodoCounterProps {
    count: number;
}


const TodoCounter = ({count}: TodoCounterProps) => {
    return (
        <Count>
            <p> {count} task remaining</p>
        </Count>
    );
};

export default TodoCounter;
